import styled from "styled-components";

const CardListBlockStyled = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 34em;
  height: 20em;
  margin: 2em;
  border-radius: 10px;
  background-color: #718093;
`;

export default CardListBlockStyled;
